import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        feiras: []
    }

    
    componentDidMount() {
        console.log(this.state);
        let feiras = [];
        feiras.push({nome: "nome 1"});
        feiras.push({nome: "nome 2"});
        console.log(feiras);
        this.setState({feiras: feiras});
        console.log(this.state.feiras);

    }

    render(){
        let fTest = this.state.feira[0].nome;
        return(
            <div>
                <Feira nome={fTest.nome}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
